import React from 'react';

const Presentation = ({numberQuestion, handleStart}) => {

    return (
    <div className="Presentation">
        <p>I have a challenge for you: could you answer all the {numberQuestion} questions?</p>
        <button onClick={handleStart} id="start-Btn">Let's started !</button>
    </div>
    )
};

export default Presentation;
